import React, { useState } from 'react';
import SubmissionLink from './components/SubmissionLinks';
import './App.css';
import SubmissionDialog1 from './components/SubmissionDialog1';
import SubmissionDialog2 from './components/SubmissionDialog2';
import SubmissionDialog3 from './components/SubmissionDialog3';
import SubmissionDialog4 from './components/SubmissionDialog4';

function App() {
  const [dialog1Open, setDialog1Open] = useState(false);
  const [dialog2Open, setDialog2Open] = useState(false);
  const [dialog3Open, setDialog3Open] = useState(false);
  const [dialog4Open, setDialog4Open] = useState(false);

  const openDialog1 = () => {
    setDialog1Open(true);
  };

  const openDialog2 = () => {
    setDialog2Open(true);
  };

  const openDialog3 = () => {
    setDialog3Open(true);
  };

  const openDialog4 = () => {
    setDialog4Open(true);
  };

  const closeDialog1 = () => {
    setDialog1Open(false);
  };

  const closeDialog2 = () => {
    setDialog2Open(false);
  };

  const closeDialog3 = () => {
    setDialog3Open(false);
  };

  const closeDialog4 = () => {
    setDialog4Open(false);
  };

  return (
    <div className="App">
      <nav>
        <ul>
          <li><SubmissionLink onClick={openDialog1} /></li>
          <li><SubmissionLink onClick={openDialog2} /></li>
          <li><SubmissionLink onClick={openDialog3} /></li>
          <li><SubmissionLink onClick={openDialog4} /></li>
        </ul>
      </nav>
      <SubmissionDialog1 isOpen={dialog1Open} onClose={closeDialog1} />
      <SubmissionDialog2 isOpen={dialog2Open} onClose={closeDialog2} />
      <SubmissionDialog3 isOpen={dialog3Open} onClose={closeDialog3} />
      <SubmissionDialog4 isOpen={dialog4Open} onClose={closeDialog4} />
    </div>
  );
}

export default App;
